Mañana Miercoles 20/marzo/24 por cuarta vez intentaran en la Camara de Diputados Federal aprobar la iniciativa de Terapias de Coversion a nivel nacional.

La iniciativa de la Bancada Trans de morena dice: "Se impondrá de 2 a 6 años de prisión y multa de mil a dos mil veces el valor diario de la Unidad de Medida y Actualización a quien realice, imparta, aplique, obligue o financie cualquier tipo de tratamiento, terapia, servicio o práctica que obstaculice, restrinja, impida, menoscabe, anule o suprima la orientación sexual, identidad o expresión de género de una persona.
Se aumentará al doble la sanción prevista cuando las conductas tipificadas se realicen en contra de personas menores de 18 años, adultos mayores o personas con alguna discapacidad."   Es decir son tan ambiguas las razones que solo les falto decir cualquiera quien sueñe o piense tmbien sera encarcelado.

