@xochitlgalvez mandó un mensaje desde Morelia, Michoacán, en donde se refirió a los 13 mil 432 niños y niñas que han sido asesinados.
En compañía de madres buscadoras, la candidata presidencial se comprometió a ayudar a los niños cuyas madres fueron víctimas de feminicidio, así como a quienes quedaron huérfanos por la pandemia de #COVID19. Aseguró que uno de los temas que más le preocupa es que en México se normalice la violencia: Seguramente esos 13 mil 431 niños no han sido noticia, pero sí han sido un tema muy doloroso para las familias”, dijo.
#TuElección2024 #Latinus #InformaciónParaTi

@xochitlgalvez, candidata de la coalición Fuerza y Corazón por México, expresó su preocupación por la falta de crítica al actual gobierno en materia de educación, lo cual atribuyó al miedo por parte de la sociedad a alzar la voz contra la administración. 
“Este gobierno ha sabido callar a la sociedad, y yo lo que les pediría como presidenta, lo único que les pido es que no se callen. Yo los voy a escuchar. Vamos a hacerlo juntos, vamos a trabajar para resolver el grave problema”, expresó Gálvez. 
#Latinus #InformaciónParaTi #TuElección2024

Gente ya está nuevamente arriba Radio Chúpala, y se habló de la “sorpresa que fue la victoria de Sheinbaum”, del nuevo corte de Peso Pluma y hasta llamadas del mes del orgullo hubo.

