@claudia_shein y otros representantes de @morena_partido sostienen que #México no está militarizado, argumentando que los miembros de la #GuardiaNacional están capacitados en seguridad pública en lugar de guerra. 
Por ejemplo, rturrent y @arturozaldivarl (ambos del equipo de campaña de Sheinbaum), han defendido que la Guardia no está militarizada, señalando que “sus funciones y formación se centran en la seguridad ciudadana”. Otra frase engañosa. 
Aunque en la Constitución se instituyó a la Guardia Nacional como una corporación de carácter civil, en los hechos se ha desarrollado como una institución militar. Ocho de cada 10 de sus integrantes provienen de las Fuerzas Armadas (@sedenamx y @semar_mx), de acuerdo con un estudio de la Dirección General de Difusión y Publicaciones del Instituto Belisario Domínguez del propio @senadomexico.

